import { Box, Grid } from "@mui/material";
import React from "react";

const ProductSummary = () => {
  return (
    <Box sx={{ width: "100%" }}>
      <Grid2
        container
        direction="row"
        justifyContent="center"
        alignItems="center"
        xs={11}
      ></Grid2></Box>
  );
};

export default ProductSummary;
